let userId = "";
const products = [
    { name: "Milk", price: 1.5, image: "data:image/jpeg;base64," },
    { name: "Cakes", price: 5, image: "data:image/jpeg;base64," },
    { name: "Canned Foods", price: 2, image: "data:image/jpeg;base64," },
    { name: "Chips", price: 1, image: "data:image/jpeg;base64," },
    { name: "Crisps", price: 1.2, image: "data:image/jpeg;base64," },
    { name: "Corn Snacks", price: 1.3, image: "data:image/jpeg;base64," },
    { name: "Nuts", price: 2.5, image: "data:image/jpeg;base64," },
    { name: "Seeds", price: 1.8, image: "data:image/jpeg;base64," }
];

let order = [];
let filteredProducts = [...products]; // Keep track of products filtered by search

window.onload = function () {
  loadProducts(filteredProducts);
};

function saveUserId() {
  const userIdInput = document.getElementById("userIdInput").value.trim();
  
  if (userIdInput === "") {
    document.getElementById("userIdError").style.display = "block";
  } else {
    userId = userIdInput;
    document.getElementById("userIdError").style.display = "none";
    document.getElementById("user-id-section").style.display = "none";
    document.getElementById("home").style.display = "block";
  }
}

function loadProducts(productsToLoad) {
  const productList = document.getElementById("product-list");
  productList.innerHTML = ""; // Clear the product list

  productsToLoad.forEach((product, index) => {
    const li = document.createElement("li");
    li.innerHTML = `
      <div>
        <img src="${product.image}" alt="${product.name}">
        <span>${product.name} - $${product.price}</span>
      </div>
      <button onclick="addToOrder(${index})">Add to Order</button>
    `;
    productList.appendChild(li);
  });
}

function addToOrder(index) {
  const productToAdd = filteredProducts[index]; // Add from filtered list
  order.push(productToAdd);
  updateOrderSummary();
}

function updateOrderSummary() {
  const orderItems = document.getElementById("order-items");
  orderItems.innerHTML = ""; // Clear previous order items

  order.forEach((item, idx) => {
    const li = document.createElement("li");
    li.innerText = `${item.name} - $${item.price}`;
    orderItems.appendChild(li);
  });
}

// Function to generate a unique Order ID
function generateOrderId() {
  return 'SSSR-' + Math.random().toString(36).substr(2, 9).toUpperCase();
}

function placeOrder() {
  if (order.length === 0) {
    document.getElementById("order-status").innerText = "Your order is empty.";
  } else {
    const orderId = generateOrderId(); // Generate a unique Order ID
    document.getElementById("order-status").innerText = `Order placed! \nUser ID: ${userId} \nOrder ID: ${orderId}`;
    order = []; // Clear the order
    updateOrderSummary();
  }
}

function showPage(page) {
  document.getElementById("home").style.display = "none";
  document.getElementById("about").style.display = "none";
  document.getElementById("contact").style.display = "none";

  document.getElementById(page).style.display = "block";
}

function searchProduct() {
  const query = document.getElementById("searchBar").value.toLowerCase();
  filteredProducts = products.filter(product => product.name.toLowerCase().includes(query));
  loadProducts(filteredProducts);
}

